import React from 'react';
import './App.css';

import {Container, Row, Col} from 'react-bootstrap';
import {BrowserRouter as Router, Route} from 'react-router-dom';

import NavigationBar from './components/NavigationBar';
import Welcome from './components/Welcome';
import Footer from './components/Footer';
import AddCountryNumber from './components/AddCountryNumber';
import ListCountryNumbers from './components/ListCountryNumbers';


function App() {
  const marginTop={
    marginTop:"20px"
  };
  return (
    <Router>
        <NavigationBar/>
        <Container>
            <Row>
                <Col lg={12} style={marginTop}>
                    <Switch>
                        <Route path="/" component={Welcome}/>
                        <Route path="add" component={AddCountryNumber}/>
                        <Route path="list" component={ListCountryNumbers}/>
                    </Switch>
                </Col>
            </Row>
        </Container>
        <Footer/>
    </Router>
  );
}

export default App;
